import pdfMake from "pdfmake/build/pdfmake";
import pdfFonts from "pdfmake/build/vfs_fonts";

import { api } from "../../services/apiClient";
import { IChart } from "../../services/hooks/useCharts";
import { IInstitution } from "../../services/hooks/useInstitutions";
import { IStudentActivity } from "../../services/hooks/useStudentActivities";
import { IUser } from "../../services/hooks/useUsers";

const generateFormReportCardPDF = async (
  studentActivities: IStudentActivity[],
): Promise<void> => {
  pdfMake.vfs = pdfFonts.pdfMake.vfs;

  const totalApprovedHours = studentActivities.reduce(
    (acc, studentActivity) => {
      return acc + studentActivity.approvedHours;
    },
    0,
  );

  let approvedStatus = {
    color: "red",
    bold: true,
    text: "REPROVADO",
  };

  let student: IUser;
  let chart: IChart;
  let institution: IInstitution;

  await api
    .get(`users/by-id?userId=${studentActivities[0].userId}`)
    .then(response => {
      student = response.data;
    })
    .catch(error => {
      console.log(error.response.data.message);
    });

  await api
    .get(`charts/by-student-id?studentId=${studentActivities[0].userId}`)
    .then(response => {
      chart = response.data as IChart;
    })
    .catch(error => {
      console.log(error.response.data.message);
    });

  await api
    .get(`institutions/by-id?institutionId=${student.institutionId}`)
    .then(response => {
      institution = response.data;
    })
    .catch(error => {
      console.log(error.response.data.message);
    });

  if (totalApprovedHours >= chart.minHours) {
    approvedStatus = {
      color: "green",
      bold: true,
      text: "APROVADO",
    };
  }

  const dateNow = new Date().toLocaleDateString("pt-BR", {
    day: "2-digit",
    month: "2-digit",
    year: "numeric",
  });

  const header = [
    {
      alignment: "center",
      fontSize: 7,
      margin: [0, 5, 0, 0],
      text: [
        "MINISTÉRIO DA EDUCAÇÃO\n",
        "SECRETARIA DE EDUCAÇÃO PROFISSIONAL E TECNOLÓGICA\n",
        student.institutionName.toUpperCase(),
        {
          fontSize: 9,
          text: "\n______________________________________________________________________________________________________________________________________________",
        },
      ],
    },
  ];

  const content = [
    {
      alignment: "center",
      fontSize: 12,
      bold: true,
      margin: [0, 30, 0, 0],
      text: "BOLETIM FINAL DAS ATIVIDADES COMPLEMENTARES",
    },
    {
      margin: [0, 30, 0, 0],
      fontSize: 10,
      style: "tableExample",
      table: {
        widths: ["*"],
        body: [
          [
            {
              text: [
                "Tipo: ",
                {
                  bold: true,
                  text: "Atividades Complementares - Componentes Curriculares Obrigatórios",
                },
                "\n\n\nAcadêmico: ",
                {
                  bold: true,
                  text: `${student.name} ${student.lastName}`,
                },
                "\n\n\nCurso: ",
                {
                  bold: true,
                  text: student.courseName,
                },
                "\n\n\nCurso iniciado no ",
                {
                  bold: true,
                  text: student.initialSemester.split("/")[0],
                },
                "° semestre de ",
                {
                  bold: true,
                  text: student.initialSemester.split("/")[1],
                },
              ],
            },
          ],
        ],
      },
    },
    {
      margin: [0, 30, 0, 0],
      fontSize: 10,
      style: "tableExample",
      table: {
        widths: ["*", "*"],
        body: [
          [
            {
              text: [
                "Carga Horária Mínima Exigida: ",
                {
                  bold: true,
                  text: `${chart.minHours}:00 `,
                },
                "hs",
              ],
            },
            {
              text: [
                "Carga Horária Total Realizada: ",
                {
                  bold: true,
                  text: `${totalApprovedHours}:00 `,
                },
                "hs",
              ],
            },
          ],
          [
            {
              text: [
                "Situação das Atividades Complementares: ",
                approvedStatus,
              ],
            },
            {
              text: [
                "Data de Emissão: ",
                {
                  bold: true,
                  text: dateNow,
                },
              ],
            },
          ],
        ],
      },
    },
    {
      alignment: "center",
      fontSize: 11,
      margin: [0, 50, 0, 0],
      text: `${institution.cityName} - ${institution.stateAcronym}, _______ de _________________ de ________.`,
    },
    {
      alignment: "center",
      margin: [0, 70, 0, 0],
      fontSize: 11,
      style: "tableExample",
      color: "#538135",
      layout: "noBorders",
      table: {
        widths: ["*", "*"],
        body: [
          [
            {
              color: "#000",
              text: "____________________________________________________",
            },
            {
              color: "#000",
              text: "____________________________________________________",
            },
          ],
          [
            { text: "Assinatura do(a) Professor(a)\nCoordenador(a) de ATC" },
            { text: "Assinatura do(a) Coordenador(a)\nde Registro Acadêmico" },
          ],
          [{}, {}],
        ],
      },
    },
  ];

  function footer(currentPage, pageCount) {
    return [
      {
        fontSize: 9,
        margin: [9, 10, 0, 0],
        text: "______________________________________________________________________________________________________________________________________________",
      },
      {
        fontSize: 9,
        margin: [20, 1, 20, 0],
        columns: [
          {
            alignment: "left",
            text: student?.courseName,
          },
          {
            alignment: "right",
            text: [
              "Página ",
              { bold: true, text: currentPage },
              " de ",
              { bold: true, text: pageCount },
            ],
          },
        ],
      },
    ];
  }

  function background() {
    return [
      {
        width: 597,
        height: 842,
        image:
          "data:image/png;base64,",
      },
    ];
  }

  const document = {
    background,
    pageSize: "A4",
    pageMargins: [15, 43, 15, 40],

    header: [header],
    content: [content],
    footer,
  };

  pdfMake.createPdf(document).open();
};

export { generateFormReportCardPDF };
